function GetCharacter(input){  
    if(("abcdefghijklmnopqrstuvwxyz").includes(input)){
        return ':regional_indicator_' + input + ":";
    }else{  
        switch (input) {
            case "0":
                return ':zero:'
                break;
            case "1":
                return ':one:'
                break;
            case "2":
                return ':two:'
                break;
            case "3":
                return ':three:'
                break;
            case "4":
                return ':four:'
                break;
